import React from "react";

const FileUpload = (props) => {
  return (
    <div className="col-lg-5 mb-3">
      <label HTMLfor="formFileMultiple" className="form-label">
        Add files
      </label>
      <input
        className="form-control"
        type="file"
        id="formFileMultiple"
        form-control-sm
        multiple
      />
    </div>
  );
};

export default FileUpload;
